//SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@chainlink/contracts/src/v0.8/VRFConsumerBase.sol";
import "base64-sol/base64.sol";

contract RandomSVG is ERC721URIStorage, VRFConsumerBase{
    bytes32 public keyHash;
    uint256 fee;
    uint256 public tokenCounter;

    //SVG PARAMS
    uint256 public maxNumberOfPaths;
    uint256 public maxNumberOfPathCommands;
    uint256 public size = 500;
    string[] public pathCommands;
    string[] public colors;
    

    mapping(bytes32 => address) public requestIdToSender;
    mapping(bytes32 => uint256) public requestIdToTokenId;
    mapping(uint256 => uint256) public tokenIdToRandomNumber;
    event requestedRandomSVG(bytes32 indexed _requestId, uint256 indexed _tokenId);
    event createdUnfinishedRandomSVG(uint256 indexed _tokenId, uint256 _randomNumber);
    event createdRandomSVG(uint256 indexed _tokenId, string _tokenURI);

    constructor(address _VRFCoordinator, address _LinkToken, bytes32 _keyHash, uint256 _fee) 
    VRFConsumerBase(_VRFCoordinator, _LinkToken) 
    ERC721("RandomSVG", "rsNFT")
    {
        fee = _fee;
        keyHash = _keyHash;
        tokenCounter = 0;
        maxNumberOfPaths = 10;
        maxNumberOfPathCommands = 5;
        pathCommands = ["M", "L"];
        colors = ["red", "blue", "green", "yellow", "black", "white"];
    }

    function create() public returns (bytes32 _requestId){
        _requestId = requestRandomness(keyHash, fee);
        requestIdToSender[_requestId] = msg.sender;
        uint256 tokenId = tokenCounter;
        requestIdToTokenId[_requestId] = tokenId;
        tokenCounter = tokenCounter + 1; 
        emit requestedRandomSVG(_requestId, tokenId);
    }

    function fulfillRandomness(bytes32 _requestId, uint256 _randomNumber) internal override{
        address nftOwner = requestIdToSender[_requestId];
        uint256 tokenId = requestIdToTokenId[_requestId];

        _safeMint(nftOwner, tokenId);
        tokenIdToRandomNumber[tokenId] = _randomNumber;
        emit createdUnfinishedRandomSVG(tokenId, _randomNumber);
    }

    function finishMint(uint256 _tokenId) public {
        require(bytes(tokenURI(_tokenId)).length <= 0, "Token URI is already all set!");
        require(tokenCounter > _tokenId, "TokenId has not been minted yet!");
        require(tokenIdToRandomNumber[_tokenId] > 0, "Need to wait for chainlink VRF");

        uint256 randomNumber = tokenIdToRandomNumber[_tokenId];
        
        string memory svg = generateSVG(randomNumber);
        string memory imageURI = svgToImageURI(svg);
        string memory formattedTokenURI = formatTokenURI(imageURI);
        _setTokenURI(_tokenId, formattedTokenURI);
        emit createdRandomSVG(_tokenId, formattedTokenURI);
    }

    function generateSVG(uint256 _randomNumber) public view returns(string memory _finalSVG){
        uint256 numPaths = (_randomNumber % maxNumberOfPaths) + 1;
        _finalSVG = string(abi.encodePacked('<svg xmlns="http://www.w3.org/2000/svg" height="', uint2str(size), '" width="', uint2str(size), '">'));

        for(uint i = 0; i < numPaths; i++){
            uint256 newRNG = uint256(keccak256(abi.encode(_randomNumber, i)));
            string memory pathSvg = generatePath(newRNG);
            _finalSVG = string(abi.encodePacked(_finalSVG, pathSvg));
        }
        _finalSVG = string(abi.encodePacked(_finalSVG, "</svg>"));
    }


    function generatePath(uint256 _randomNumber) public view returns(string memory _pathSvg){
        uint256 numPathCommands = (_randomNumber % maxNumberOfPathCommands) + 1;
        _pathSvg = "<path d='";
        
        for(uint i = 0; i < numPathCommands; i++){
            uint256 newRNG = uint256(keccak256(abi.encode(_randomNumber, size + i)));
            string memory pathCommand = generatePathCommand(newRNG);
            _pathSvg = string(abi.encodePacked(_pathSvg, pathCommand));
        }
        string memory color = colors[_randomNumber % colors.length];
        _pathSvg = string(abi.encodePacked(_pathSvg, "' fill='transparent' stroke='", color, "'/>"));
        return _pathSvg;
    }

    function generatePathCommand(uint256 _randomNumber) public view returns(string memory _pathCommand){
        _pathCommand = pathCommands[_randomNumber % pathCommands.length];
        uint256 parameterOne = uint256(keccak256(abi.encode(_randomNumber, size * 2))) % size;
        uint256 parameterTwo = uint256(keccak256(abi.encode(_randomNumber, size * 3))) % size;
        _pathCommand = string(abi.encodePacked(_pathCommand, " ",  uint2str(parameterOne), " ", uint2str(parameterTwo)));

    }


    function svgToImageURI(string memory _svg) public pure returns (string memory){
        string memory baseURL = "data:image/svg+xml;base64,";
        string memory svgBase64Encoded = Base64.encode(bytes(string(abi.encodePacked(_svg))));
        string memory imageURI = string(abi.encodePacked(baseURL, svgBase64Encoded));

        return imageURI;
    }

    function formatTokenURI(string memory _imageURI) public pure returns (string memory){
        string memory baseURL = "data:application/json;base64,";
        return string(abi.encodePacked(
            baseURL, 
            Base64.encode(
                bytes(abi.encodePacked(
                    '{"name": "MorseNFT",', 
                    '"description": "Morse Code NFT",', 
                    '"attributes": "",', 
                    '"image":', _imageURI, '}'
                    )
                ))
            ));
    }

    function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

}
